#!/bin/python3
import time

'''
  Given an integer, we need to find the super digit of the integer.
  If x has only 1 digit, then its super digit is x.
  Otherwise, the super digit of  is equal to the super digit of the sum of the digits of x.
  :param n: The input interger n.
  :type n: int
  :param k: The no. of repetitions of integer n
  :type k: int
  :return: The super digit of n
  :rtype: int
'''
def super_digit(n, k):
  string = str(n)
  if(len(string) == 1 and k == 1):
    return int(string)
  sum = 0
  for s in string:
    sum += int(s)
  return super_digit(sum * k, 1)


